import Post from "../components/Post";
import Grid from "../elements/Grid";
import Dropdown from "../components/Dropdown";

const PostList = () => {
  return (
    <React.Fragment>
      <div></div>
      <h1 style={{ textAlign: "center", fontSize: "38px", marginTop: "50px" }}>
        중고거래 인기매물
      </h1>

      <div style={{}}>
        <Dropdown></Dropdown>
      </div>

      <div
        style={{
          display: "flex",
          flexWrap: "wrap",
        }}
      >
        <Post />
        <Post />
        <Post />
        <Post />
        <Post />
        <Post />
        <Post />
        <Post />
        <Post />
      </div>
    </React.Fragment>
  );
};

export default PostList;
